import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('load');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category to get to product listing page
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for products to load and take screenshot
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Wait for and click the list view button
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.click('.view-btn[title="List View"]');

    // Wait for list view to activate
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Verify list view is active
    const listViewActive = await page.$eval('.view-btn[title="List View"]', btn => 
      btn.classList.contains('active')
    );

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        listViewActive: listViewActive,
        productCount: await page.$$eval('.product-card-list', elements => elements.length)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
